/*=================================================
   Create variable to store the tag for make changes on it
=================================================*/

var rod1 = document.getElementById("rod1");
var rod2 = document.getElementById("rod2");
var ball = document.getElementById("ball");


/*==========================================
Create variable for store value
============================================= */
let score,
  scorey,
  maxScore,
  movement,
  rod,
  ballSpeedX = 2,
  ballSpeedY = 2;



/*====================================================
  make Key value useful for setAttribute method(key,value)
====================================================== */
const storeName = "keyName";
const storeScore = "keyMaxScore";
const rod1Name = "Rod 1";
const rod2Name = "Rod 2";


/*=====================================
 Boolean variable gameOn 
======================================= */
let gameOn = false;



/*============================================
Strore in variable window width and window Height
=============================================*/
let windowWidth = window.innerWidth;
let windowHeight = window.innerHeight;



/*====================== ALERT MESSAGE=====================================*/

function EnterAlert() {
  rod = localStorage.getItem(storeName);
  maxScore = localStorage.getItem(storeScore);

  if (rod === null || maxScore === null) {
    alert(
      'This is the "First time " you are playing this game. LET\'S START "A for Left" and "D for Right"Rod Move'
    );
    rod = "Rod 2";
    maxScore = 0;
  } else {
    alert(rod + " has maximum score of " + maxScore * 100);
  }

  /*========================================================
          After alert ok set all players Rod and Ball
  ============================================================*/
  SetPlayer(rod);
}
/* ==============================================================
           call function for show alert
=================================================================*/
EnterAlert();

/*=========================================================================================
           Set all players Rod at center of window ball at top of last Rod miss ball
=============================================================================================*/
function SetPlayer(rodName) {
  /*==================================================================================================
                   Calculate center of the page half of 
      window.innerWidth is mid point and rodwidth half subsctract
  ===========================================================================*/
  rod1.style.left = (windowWidth - rod1.offsetWidth) / 2 + "px";
  rod2.style.left = (windowWidth - rod2.offsetWidth) / 2 + "px";
  ball.style.left = (windowWidth - ball.offsetWidth) / 2 + "px";
  score = 0;
  scorey = 0;
  /*======================================================
    Set ball position as per last ball miss by rod1 or rod2
  ========================================================*/
  if (rodName === rod2Name) {
    score = 1;
    /*=====================================================
       set ball position at rod1 
    ===================================================== */
    ball.style.top = rod1.offsetTop + rod1.offsetHeight + "px";
    ballSpeedY = 2;
  } else if (rodName === rod1Name) {
    scorey = 1;
    /*======================================================
       set ball position at top of rod2 
    ======================================================= */
    ball.style.top = rod2.offsetTop - rod2.offsetHeight + "px";
    //  set ball speed
    ballSpeedY = -2;
  }
  /* ===================================================
       set gameOn false and score 0 new or again start
  =======================================================*/

  gameOn = false;
}
/*=======================================================
   Store winner score and name using localStorage 
=========================================================*/
function storeWin(rod, score) {
  if (score > maxScore) {
    maxScore = score;

    localStorage.setItem(storeName, rod);
    localStorage.setItem(storeScore, maxScore);
  }
  // stop ball movement using clearInterval
  clearInterval(movement);
  SetPlayer(rod);
  /*=====================================
   Show winner and maximum score 
=======================================*/
  alert(
    rod +
      " wins with a score of " +
      score * 100 +
      ". Max score is: " +
      maxScore * 100
  );
}
/* ========================================================
      Event handler using addEventListener 
 "A" key for left move "D" for Right move use keyEvent 
============================================================*/
window.addEventListener("keypress", function (event) {
  let rodSpeed = 20;
  let rodRect = rod1.getBoundingClientRect();
  /*=========================================================================
===--> "D" keyPress then move rod to right ==========>
==============================================================================*/
  if (event.code === "KeyD" && rodRect.x + rodRect.width < window.innerWidth) {
    rod1.style.left = rodRect.x + rodSpeed + "px";
    rod2.style.left = rod1.style.left;
  } else if (event.code === "KeyA" && rodRect.x > 0) {
    /* <---=================================== 
  <======"A" keyPress Rod move left <--=====
  =========================================*/
    rod1.style.left = rodRect.x - rodSpeed + "px";
    rod2.style.left = rod1.style.left;
  }

  if (event.code === "Enter") {
    if (!gameOn) {
      gameOn = true;
      let ballRect = ball.getBoundingClientRect();
      let ballX = ballRect.x;
      let ballY = ballRect.y;
      let ballDia = ballRect.width;

      let rod1Height = rod1.offsetHeight;
      let rod2Height = rod2.offsetHeight;
      let rod1Width = rod1.offsetWidth;
      let rod2Width = rod2.offsetWidth;

      /*=================================================
MAKE THE BALL MOVE.
Change position of the ball in x and y directions both, 
continuously until game over condition becomes true
=================================================*/

      movement = setInterval(function () {
        /*=====================================================
        Move ball after every "10" miliseconds using setInterval
        ======================================================*/
        ballX += ballSpeedX;
        ballY += ballSpeedY;
        /*======================================================
          Top of rod position find using getBoundingClientRect()
        ======================================================== */
        var rod1X = rod1.getBoundingClientRect().x;
        var rod2X = rod2.getBoundingClientRect().x;
        /* Assign ball left and top value to ball style */
        ball.style.left = ballX + "px";
        ball.style.top = ballY + "px";
        /*======================================
           When ball touch to screen then ball 
            movement speed direction change
        ===================================== */
        if (ballX + ballDia > windowWidth || ballX < 0) {
          ballSpeedX = -ballSpeedX; // Reverses the ball direction
        }

        let ballPos = ballX + ballDia / 2;

        // Check for Rod 1
        if (ballY <= rod1Height) {
          ballSpeedY = -ballSpeedY; // Reverses the direction
          score++;

          // Check ball position
          if (ballPos < rod1X || ballPos > rod1X + rod1Width) {
            storeWin(rod2Name, scorey);
          }
        }

        // if Rod 2 play the ball
        else if (ballY + ballDia >= windowHeight - rod2Height) {
          ballSpeedY = -ballSpeedY; // Reverses the direction ball go up
          scorey++;

          // if Rod2 miss the ball
          if (ballPos < rod2X || ballPos > rod2X + rod2Width) {
            storeWin(rod1Name, score);
          }
        }
      }, 10); /* This is 10 milisecond time after every 10ms ball move*/
    }
  }
});
